808 State is an English electronic music outfit formed in 1988 in Manchester, taking their name from the Roland TR-808 drum machine and the &quot;state of mind&quot; shared by the members. They were formed by Graham Massey, Martin Price and Gerald Simpson (later to record as A Guy Called Gerald) and released their debut Newbuild in 1988.





